def draw_square(id, x,y,s,c, parent):

    style = {   'stroke'        :  "black",
                'fill'          : c,
                'stroke-width'  :  str(s/64.0),
            }
                
    attribs = {
        'style'     :simplestyle.formatStyle(style),
        'height'    : str(s*1.01 ),
        'width'     : str(s*1.01 ),
        'x'         : str(x*s ),
        'y'         : str((8-y)*s ),
          'id' : id
            }
    circ = inkex.etree.SubElement(parent, inkex.addNS('rect','svg'), attribs )
    
def draw_border(s,parent):

    style = {   'stroke'        :  "black",
                'stroke-width'  :  str(0.06*s),
                'fill'          : "none"
            }
                
    attribs = {
        'style'     :simplestyle.formatStyle(style),
        'height'    : str(s*9 ),
        'width'     : str(s*9 ),
        'x'         : '0',
        'y'         : '0',
            }
    circ = inkex.etree.SubElement(parent, inkex.addNS('rect','svg'), attribs )

def draw_piece(x,y,s,c,p,mono,pc,flip,parent):
  if flip:
    x=8-x
    y=8-y
  grp_attribs = {'id':'piece'+str(y*10+x)
                    }
  grp = inkex.etree.SubElement(parent, 'g', grp_attribs)
  if c==WHITE and not flip or c==BLACK and flip :
    style = {   'stroke'        :  "none",
                'stroke-width'  :  str(0.06*s),
                'fill'          : pc
            }
    attribs = {
        'style'     :simplestyle.formatStyle(style),
          'd': pics_white_outline[8 if p==KING and c==WHITE else p],
          'transform': 'translate('+str((x+(120-pics_size[8 if p==KING and c==WHITE else p])/240.0)*s)+','+str((8-y-0.03)*s)+') scale('+str(s/120.0)+')',
            }
  
    circ=inkex.etree.SubElement(grp,'path',attribs)
    style = {   'stroke'        :  "none",
                'stroke-width'  :  str(0.06*s),
                'fill'          : "black" if p<=8 or mono else "darkred"
            }
    attribs = {
        'style'     :simplestyle.formatStyle(style),
          'd': pics_white[8 if p==KING and c==WHITE else p],
          'transform': 'translate('+str((x+(120-pics_size[8 if p==KING and c==WHITE else p])/240.0)*s)+','+str((8-y-0.03)*s)+') scale('+str(s/120.0)+')',
            }
  
    circ=inkex.etree.SubElement(grp,'path',attribs)
  else:
    style = {   'stroke'        :  "none",
                'stroke-width'  :  str(0.06*s),
                'fill'          : pc
            }
    attribs = {
        'style'     :simplestyle.formatStyle(style),
          'd': pics_black_outline[8 if p==KING and c==WHITE else p],
          'transform': 'translate('+str((x+(120-pics_size[8 if p==KING and c==WHITE else p])/240.0)*s)+','+str((8-y+0.05)*s)+') scale('+str(s/120.0)+')',
            }
  
    circ=inkex.etree.SubElement(grp,'path',attribs)
    style = {   'stroke'        :  "none",
                'stroke-width'  :  str(0.06*s),
                'fill'          : "black" if p<=8 or mono else "darkred"
            }
    attribs = {
        'style'     :simplestyle.formatStyle(style),
          'd': pics_black[8 if p==KING and c==WHITE else p],
          'transform': 'translate('+str((x+(120-pics_size[8 if p==KING and c==WHITE else p])/240.0)*s)+','+str((8-y+0.05)*s)+') scale('+str(s/120.0)+')',
            }
  
    circ=inkex.etree.SubElement(grp,'path',attribs)


def fen2board(fen):
  
  ws=string.split(fen,' ')
  b=[[(-1,-1) for i in range(9)] for j in range(9) ]
  y=8
  x=0
  pro=0
  for c in ws[0]:
    if (c==' '):
      break
    elif (c>='0' and c<='9'):
      x+=ord(c)-ord('0')
    elif (c=='/'):
      y-=1
      x=0
    elif (c=='+'):
      pro=1
    elif (x>=0 and x<9):
      if c=='K':
        p=KING
        t=WHITE
      elif c=='R':
        p=PROROOK if pro==1 else ROOK 
        t=WHITE
      elif c=='B':
        p=PROBISHOP if pro==1 else BISHOP
        t=WHITE
      elif c=='G':
        p=GOLD
        t=WHITE
      elif c=='S':
        p=PROSILVER if pro==1 else SILVER
        t=WHITE
      elif c=='N':
        p=PROKNIGHT if pro==1 else KNIGHT
        t=WHITE
      elif c=='L':
        p=PROLANCE if pro==1 else LANCE
        t=WHITE
      elif c=='P':
        p=PROPAWN if pro==1 else PAWN
        t=WHITE
      elif c=='k':
        p=KING
        t=BLACK
      elif c=='r':
        p=PROROOK if pro==1 else ROOK 
        t=BLACK
      elif c=='b':
        p=PROBISHOP if pro==1 else BISHOP
        t=BLACK
      elif c=='g':
        p=GOLD
        t=BLACK
      elif c=='s':
        p=PROSILVER if pro==1 else SILVER
        t=BLACK
      elif c=='n':
        p=PROKNIGHT if pro==1 else KNIGHT
        t=BLACK
      elif c=='l':
        p=PROLANCE if pro==1 else LANCE
        t=BLACK
      elif c=='p':
        p=PROPAWN if pro==1 else PAWN
        t=BLACK
      else:
        p=-1
        t=-1
      b[y][x]=(p,t)
      x+=1
      pro=0
    if (y<0 or y>=9):
      break
  return b

def render_chessboard(fen, piecesize, pc,bc,mono,flip,parent):
  
  grp_attribs = {'id':'chessboard'
                    }
  grp = inkex.etree.SubElement(parent, 'g', grp_attribs)
  if mono:
    bc="white"
    pc="white"
  else:
    bc='#'+bc
    pc='#'+pc

  for y in range(0,9):
    for x in range(0,9):
      draw_square(chr(49+8-x)+chr(97+8-y),x,y,piecesize,bc,grp)
  draw_border(piecesize,grp)
  
  grp_attribs = {'id':'pieces'
                    }
  grp = inkex.etree.SubElement(parent, 'g', grp_attribs)
  b=fen2board(fen)
  for y in range(0,9):
    for x in range(0,9):
      (p,t)=b[y][x]
      if p!=-1 and t!=-1:
        draw_piece(x,y,piecesize,t,p,mono,pc,flip,grp)
  

class InsertChessboard(inkex.Effect):
   

  def __init__(self):
    inkex.Effect.__init__(self)
    self.OptionParser.add_option("-s", "--piecesize",
            action="store", type="int",
            dest="piecesize", default=64,
            help="Piece size")
    self.OptionParser.add_option("-f", "--fen",
            action="store", type="string",
            dest="fen", default="lnsgkgsnl/1r5b1/ppppppppp/9/9/9/PPPPPPPPP/1B5R1/LNSGKGSNL w 0 1",
            help="FEN")
            
    self.OptionParser.add_option("-p", "--piececolor",
            action="store", type="string",
            dest="piececolor", default="ffffcc",
            help="Color of pieces")
    self.OptionParser.add_option("-b", "--boardcolor",
            action="store", type="string",
            dest="boardcolor", default="eabd7e",
            help="Color of board")
    self.OptionParser.add_option("-m", "--mono",
            action="store", type="inkbool",
            dest="mono", default=True,
            help="monochrome")
    self.OptionParser.add_option("-r", "--flip",
            action="store", type="inkbool",
            dest="flip", default=True,
            help="flipboard")
           


  def effect(self):
    so = self.options
    x, y = self.view_center
    size=so.piecesize*self.unittouu('1mm')
    x-=size*4.5
    y-=size*4.5
    grp_transform = 'translate' + str( (x,y) )
    grp_name = 'ChessBoard'
    grp_attribs = {inkex.addNS('label','inkscape'):grp_name,
                   'transform':grp_transform }
    grp = inkex.etree.SubElement(self.current_layer, 'g', grp_attribs)#the group to put everything in

    render_chessboard(so.fen, size, so.piececolor, so.boardcolor,so.mono,so.flip, grp )    # generate the SVG elements

if __name__ == '__main__':
        e = InsertChessboard()
        e.affect()

